import React from 'react';
import style from '../../style.scss';
import Photo from '../../img/profil.svg';

const CheckboxComponents = () => {
  return (
    <div className={`checkbox-container ${style['checkbox-container']}`}>
      {/* Utilisation de la classe "scrollable" pour ajouter le d√©filement */}
      {/* <ul className="scrollable"> */}
      <ul className="scrollable">
        <li>
          <img src={Photo} alt="Profile" />
          <p>Aaron James</p>
          <input type="checkbox" />
        </li>
        <li><img src={Photo} alt="Profile" /><p>Amanda Wallace</p><input type="checkbox" /></li>
        <li><img src={Photo} alt="Profile" /><p>Angela Danger</p><input type="checkbox" /></li>
        <li><img src={Photo} alt="Profile" /><p>Abella white</p><input type="checkbox" /></li>
        <li><img src={Photo} alt="Profile" /><p>Darlene Robertsone</p><input type="checkbox" /></li>
        <li><img src={Photo} alt="Profile" /><p>Fred Davis</p><input type="checkbox" /></li>
        <li><img src={Photo} alt="Profile" /><p>Aaron Smith</p><input type="checkbox" /></li>
        <li><img src={Photo} alt="Profile" /><p>Aaron Smith</p><input type="checkbox" /></li>
      </ul>
    </div>
  );
}

export default CheckboxComponents;
